{'mediaType': 2, 'likeCount': 2369, 'commentCount': 16, 'caption': "Patek Philippe timepieces have been a fixture on London’s prestigious Bond Street in the heart of the city for decades before the establishment of the Salons. In the 1980s, the manufacture secured an exclusive location on Bond Street within the Watches of Switzerland Boutique, solidifying its presence in one of the world’s most elegant destinations. In 2008, the London Salon was officially created, marking a new chapter in the brand’s history. 

Over the years, the Salon has expanded and been renovated; it now spans approximately 1,000 m², showcasing Patek Philippe's commitment to creating an unparalleled experience and presenting the largest range of its timepieces in the UK.

