{'mediaType': 2, 'likeCount': 4473, 'commentCount': 53, 'caption': "The Geneva Salons has become a landmark in the city of Geneva. The space became iconic in 1853, when it found its permanent residents on rue du Rhône. It has become an address that has endured for more than 170 years, embedding itself in the city's fabric. This opulent yet serene place invites guests to explore and savor their experience. The space required the expertise and collaboration of artisans possessing exceptional craftsmanship, dedicated to preserving and perpetuating traditional artisanal skills.

Our historic manufacturing headquarters now serves our clientele as a revered sanctuary, known simply as “The Salons”. It remains the only place where the entire current collection is showcased.

#PatekTime #PatekPhilippeSalons", 'isCollaborated': False, 'viewCount': 186961}

post12:
{'mediaType': 8, 'likeCount': 6037, 'commentCount': 35, 'caption': "In 1985 Patek Philippe released a now landmark self-winding perpetual calendar wristwatch, the round-cased Ref. 3940. The model's aesthetic and mechanical influence would go on to inspire a host of perpetual calendar wristwatches. This was the company’s first model to be equipped with the caliber 240 Q (a refinement of the legendary caliber 240) and its dial configuration – with the day of the week and 24-hour indicators on a sub-dial at nine o’clock; the month and leap-year on a sub-dial at three o’clock; and the date and the moon phases at six o’clock – became the blueprint for Patek Philippe perpetual calendars. 

In 1992 the Ref. 5040 was Patek Philippe’s first perpetual calendar to combine the celebrated caliber 240 Q and the same dial configuration as the Ref. 3940, but in a modern cushion-shaped case. Then in 2012, the now iconic Ref. 5940 was launched, with an art-deco-style cushion-shaped case design – truly a timepiece for the aesthete. 

#PatekTime", 'isCollaborated': False, 'viewCount': 0}

